import React from 'react';



export const Alphabet = (props) => {
    console.log("Alphabet: " + props.alphabet)
    return(
        <div className="ui grid container alphabet">
            {props.alphabet.map(letter=>{
                <div style={{background: "white", width: "70px", height: "70px"}} className="ui item draggable" key={letter}>{letter}</div>
            })}
                        
        </div>
    )
            
}
